import React from "react";

const ListProduct = (props) => {

    const changeRouter = (productName) => {
        productName = productName.replace(/ /gi, "-")
        props.history.replace("/product-detail/" + productName)
    }
    return (
        <div>
            <div className="card card-list-product p-0 m-3" style={{ width: "15rem" }}>
                <img src={"http://0.0.0.0:5000/img/" + props.image} className="card-img-top" alt={props.name} />
                <div className="card-body text-center p-0">
                    <p className="card-text">{props.name}</p>
                    <p className="card-text">{props.price}</p>
                </div>
            </div>
        </div>
    )
}

export default ListProduct;
